import React from "react";
import classes from "./StaffSalary.module.css";
import { Bar } from "react-chartjs-2";

export default function StaffSalary() {
  let staffData = [
    {
      name: "OB1CHAM",
      rank: "Модератор",
      mainSalary: 150,
      asnwerForum: 3,
      online: "21:00:00",
      additionallyOnline: "13:55",
      bonus: 200,
      totalWeek: 455,
      totalAllTime: 10,
      birthday: "3 сентября",
    },
  ];
  staffData.push(staffData[0]);
  staffData.push(staffData[0]);
  staffData.push(staffData[0]);
  staffData.push(staffData[0]);
  const barChartData = {
    labels: ["October", "November", "December"],
    datasets: [
      {
        data: [8137119, 9431691, 10266674],
        label: "Infected People",
        borderColor: "#3333ff",
        backgroundColor: "rgba(0, 0, 255, 0.5)",
        fill: true,
      },
      {
        data: [1216410, 1371390, 1477380],
        label: "Deaths People",
        borderColor: "#ff3333",
        backgroundColor: "rgba(255, 0, 0, 0.5)",
        fill: true,
      },
    ],
  };
  return (
    <div>
      <table className={classes.staffSalaryTable}>
        <thead>
          <tr>
            <td>Никнейм модератора</td>
            <td>Должность на сервере</td>
            <td>Основная зарплата</td>
            <td>Ответы на форуме</td>
            <td>Отыгранный онлайн</td>
            <td>Дополнительный онлайн</td>
            <td>Дополнительный бонус</td>
            <td>Итог за неделю</td>
            <td>Общий итог</td>
            <td>День рождения</td>
          </tr>
        </thead>
        <tbody>
          {staffData.map((player, index) => {
            return (
              <tr key={index}>
                <td>{player["name"]}</td>
                <td>{player["rank"]}</td>
                <td>{player["mainSalary"]}</td>
                <td>{player["asnwerForum"]}</td>
                <td>{player["online"]}</td>
                <td>{player["additionallyOnline"]}</td>
                <td>{player["bonus"]}</td>
                <td>{player["totalWeek"]}</td>
                <td>{player["totalAllTime"]}</td>
                <td>{player["birthday"]}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
      <Bar />
      {/* <Bar
        type="bar"
        width={130}
        height={50}
        options={{
          title: {
            display: true,
            text: "COVID-19 Cases of Last 3 Months",
            fontSize: 15,
          },
          legend: {
            display: true, //Is the legend shown?
            position: "top", //Position of the legend.
          },
        }}
        data={barChartData}
      /> */}
    </div>
  );
}
